import React, { useState } from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@mui/material';
import TableRowComponent from './tableRowComponent';

const TrackingStatus = () => {
  const columns = [
    "Номер заказа",
    "Дата создания",
    "Статус",
    "Сумма документа",
    "Номер телефона",
    "Полное имя",
    "Себестоимость"
  ];

  // Допустим, у нас есть начальный список заказов
  const [orders, setOrders] = useState([
    { orderNumber: '1', dateCreated: '01.01.2024', status: 'Обработан', documentCost: '$100.00', phoneRecipient: '+380123456789', recipientFullName: 'Иван Иванов', costOfGoods: '$50.00' }
    // Можно добавить больше заказов для демонстрации
  ]);

  return (
    <TableContainer component={Paper} style={{ marginTop: '20px', marginBottom: '20px' }}>
      <Table>
        <TableHead>
          <TableRow>
            {columns.map((column, index) => (
              <TableCell key={index}>{column}</TableCell>
            ))}
          </TableRow>
        </TableHead>
        <TableBody>
          {orders.map((order, index) => (
            <TableRowComponent key={index} row={order} />
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
};

export default TrackingStatus;
